import React from "react";
import Icon from './icon';

export function Sidebar(props) {
  let Items = [];
  let i = 0;
  props.map((element, i) =>
    Items += <Icon iconUrl = {element.icons[i].icon} title = {element.icons[i].title}/>
  )
          
  
